import * as React from "react"
import PropTypes from "prop-types"
import { Link } from "gatsby"
import "./header.css"

import { ReactComponent as Pasteurlogo } from "../images/institut-pasteur.svg"
import MilieuInterieurlogo from "../images/milieu-interieur.png"

const Header = ({ locale }) => (
  <header>
    <div className="l-constrained-wide">
      <div className="logos">
        <Link
          title={
            locale === "fr"
              ? "Aller à la page d'accueil de Milieu Intérieur"
              : "Go to Milieu Intérieur home page"
          }
          to={locale === "fr" ? "/fr/" : "/en/"}
        >
          <img
            alt="Milieu Intérieur"
            src="data:image/png;base64,"
          />
          <Pasteurlogo alt="Institut Pasteur" />
        </Link>
      </div>
    </div>
  </header>
)

Header.propTypes = {
  locale: PropTypes.string.isRequired,
}

export default Header
